import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div>
        <Header />
        <Tehnologes />
    </div>
  );
};

const Tehnologes = () => {
  return (
    <div>
      <ul>
        <li>css</li>
        <li>js</li>
        <li>React</li>
      </ul>
    </div>
  );
};

const Header = () => {
  return (
    <div>
      <a>Home</a>
      <a>News read</a>
      <a>Message</a>
    </div>
  );
};

export default App;
